Syntax Union : union IDENTIFIER GenericParams ? WhereClause ? { StructFields } A union declaration uses the same syntax as a struct declaration, except with union in place of struct. #[repr(C)]
union MyUnion { f1: u32, f2: f32,
} The key property of unions is that all fields of a union share common storage. As a result, writes to one field of a union can overwrite its other fields, and size of a union is determined by the size of its largest field. Union field types are restricted to the following subset of types: Copy types References (&T and &mut T for arbitrary T) ManuallyDrop<T> (for arbitrary T) Tuples and arrays containing only allowed union field types This restriction ensures, in particular, that union fields never need to be dropped. Like for structs and enums, it is possible to impl Drop for a union to manually define what happens when it gets dropped.

