Since union fields share common storage, gaining write access to one field of a union can give write access to all its remaining fields. Borrow checking rules have to be adjusted to account for this fact. As a result, if one field of a union is borrowed, all its remaining fields are borrowed as well for the same lifetime. # union MyUnion { f1: u32, f2: f32 }
// ERROR: cannot borrow `u` (via `u.f2`) as mutable more than once at a time
fn test() { let mut u = MyUnion { f1: 1 }; unsafe { let b1 = &mut u.f1;
// ---- first mutable borrow occurs here (via `u.f1`) let b2 = &mut u.f2;
// ^^^^ second mutable borrow occurs here (via `u.f2`) *b1 = 5; }
// - first borrow ends here assert_eq!(unsafe { u.f1 }, 5);
} As you could see, in many aspects (except for layouts, safety, and ownership) unions behave exactly like structs, largely as a consequence of inheriting their syntactic shape from structs. This is also true for many unmentioned aspects of Rust language (such as privacy, name resolution, type inference, generics, trait implementations, inherent implementations, coherence, pattern checking, etc etc etc).

