} impl Foo { fn bar(&mut self) { println!("In struct impl!") }
} impl Bar for Foo { fn bar(&self) { println!("In trait impl!") }
} fn main() { let mut f = Foo{}; f.bar();
} If this results in multiple possible candidates, then it is an error, and the receiver must be converted to an appropriate receiver type to make the method call. This process does not take into account the mutability or lifetime of the receiver, or whether a method is unsafe. Once a method is looked up, if it can't be called for one (or more) of those reasons, the result is a compiler error. If a step is reached where there is more than one possible method, such as where generic methods or traits are considered the same, then it is a compiler error. These cases require a disambiguating function call syntax for method and function invocation. Edition Differences : Before the 2021 edition, during the search for visible methods, if the candidate receiver type is an array type , methods provided by the standard library IntoIterator trait are ignored. The edition used for this purpose is determined by the token representing the method name. This special case may be removed in the future. Warning: For trait objects , if there is an inherent method of the same name as a trait method, it will give a compiler error when trying to call the method in a method call expression. Instead, you can call the method using disambiguating function call syntax , in which case it calls the trait method, not the inherent method. There is no way to call the inherent method. Just don't define inherent methods on trait objects with the same name as a trait method and you'll be fine.

